import React from "react";
import CartItem from "./CartItem";
import Modal from "./Modal";
import "./ModuleHolder.css"

const ModalHolder = (props) => {
    var modal = props.modalName;
   
    const closeModal=()=>{
        props.onClose();
    }

    return (
        <React.Fragment>
            {modal === "projects" &&
                <Modal onClose={closeModal}
                >
                    <h2 className="title_name" >Projects</h2>
                    <ul>
                        <CartItem id="1" title="Food Order App" describe="An app allows you to order food." />
                        <CartItem id="2" title="Expense Handler" describe="An app allows you to order food." />
                        <CartItem id="3" title="Typo Application" describe="An app allows you to order food." />
                        <CartItem id="4" title="Netwiz" describe="An app allows you to order food." />
                        <CartItem id="5" title="Food Order App" describe="An app allows you to order food." />
                    </ul>
                   
                </Modal>
            }
            {modal === "skills" &&
                <Modal onClose={closeModal} >
                    <h2>Skills</h2>
                    
                </Modal>
            }
            {modal === "experience" &&
                <Modal onClose={closeModal} >
                    <h2>Experience</h2>
                    <ul>
                        
                        
                        
                        
                        
                    </ul>
                </Modal>
            }
            {modal === "achievements" &&
                <Modal onClose={closeModal} >
                    <h2>Achievements</h2>
                    <ul>
                        
                        
                        
                        
                        
                    </ul>
                </Modal>
            }
        </React.Fragment>
    )
}

export default ModalHolder;
